import ReactDOM from 'react-dom'
import React from 'react'
import Button from '@material-ui/core/Button';
import './index.css'
import SignInSide from './SignInSide.js'
import { TextField } from '@material-ui/core';

function Header() {
    return (
        <div class="jss3">
            
        </div>
    )
}

function NavbarLogin() {
    return (
        <span class="navbar-child" id="login-span">
            <button id="login">
            </button>
        </span>
    )
}

function NavbarHamburger() {
    return (
        <span class="navbar-child">
            <button id="hamburger">
            </button>
        </span>
    )
}

function NavbarTitle() {
    return (
        <span class="navbar-child" id="navbar-title">
            
        </span>
    )
}

function Navbar() {
    return (
        <div class="navbar-main navbar-position">
            <NavbarHamburger />
            <NavbarTitle />
            <NavbarLogin />
        </div>
    )
}

ReactDOM.render(
    [
        <Navbar />,
        <TextField
        variant="outlined"
        margin="normal"
        required
        fullWidth
        name="password"
        label="Password"
        type="password"
        id="password"
        autoComplete="current-password"
      />
    ],
    document.getElementById('root')
);
